import App from "@/App.vue";
import AuthUser from "@/components/authUser.vue";
import VueRouter from 'vue-router';
window.Vue = require('vue');

export default new VueRouter({
  mode: "history",
  routes: [
    {
      path: "/",
      name: "home",
      component: App,
    },
    {
      path: "/auth",
      name: "authUser",
      component: AuthUser,
    },
  ],
});
